import { useTranslation } from 'react-i18next';
import { useEffect } from 'react';
import Logo from './components/Logo/index';
import Header from './components/Header/index';
import PageLanguage from './components/PageLanguage/index';
import { SearchSettings, AdvancedSearch, YourDataInSearch, SearchHistory, SearchHelp, SendFeedback, Separator, Toggle, toggleTheme } from './components/Footer/index';
import Form from './components/Form/index';
import { ThemeProvider } from 'styled-components';
import { GlobalStyles } from './components/Theme/global';
import { useTheme } from './components/Theme/useTheme';
import { lightTheme } from './components/Theme/light';
import { darkTheme } from './components/Theme/dark';
import './App.css';

function Website() {
  const { t } = useTranslation()
  useEffect(() => {
    document.title = "Google"
 }, []);

 const [theme] = useTheme();
 const themeMode = theme === 'light' ? lightTheme : darkTheme;

  return ( <>
    <ThemeProvider theme={themeMode}>
      <GlobalStyles />
      <Header />
        <main>
          <Logo />
          <Form />
          <PageLanguage />
        </main>
        <ul className="panel" role="menu">
      <SearchSettings />
      <AdvancedSearch />
      <YourDataInSearch />
      <SearchHistory />
      <SearchHelp />
      <SendFeedback />
      <Separator />
      <Toggle theme={theme} toggleTheme={toggleTheme} />
    </ul>
    </ThemeProvider>
    </>
  );
}

export default Website
